import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Navigation from './components/Navigation';
import Portfolio from './pages/Portfolio';

const App = () => {
  return (
    <Router>
            <Navigation />
            <Route path="/" exact component={Portfolio} />
    </Router>
  )
}

export default App;
